const Blog = ({ blog, addLike, deleteBlog }) => {
  console.log(blog)
  return (

    <div className="blog">
    <h1> {blog.title} {blog.author} </h1>
    <p>{blog.url} </p>
    <p>likes: {blog.likes}</p><button onClick={addLike}>like</button>
    <button onClick={deleteBlog}>delete</button> 
    <p> added by {blog.user.name}</p>
    </div>

)}

export default Blog
